import React from 'react';
import { Landing } from './Components/Login.js';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { MDBContainer } from 'mdb-react-ui-kit';


function App() {
  return (
    <MDBContainer className="border border-primary mt-5">
      <div className="row row-cols-2">
        div.col
        <Router>
          <Switch>
            <Route path="/">
              <Landing />
            </Route>
          </Switch>
        </Router>
      </div>

    </MDBContainer>
  );
}

export default App;
